import { PrevPageBtn } from "../../../general_compo/reusable_operations/PrevPageBtn";
import { Form, Formik } from "formik";
import { FormikControl } from "../../../formik/FormikControl_AddItems";
import { SubmitBtn } from "../../../formik/SubmitBtn";
import {
  initialValues,
  onSubmit,
  validationSchema,
} from "../FormikHelper_brands";
import { TestModal } from "./TestModal";

export const AddNewBrands = () => {
  return (
    <div className="bg-danger">
      <button
        type="button"
        className="btn btn-success d-flex justify-content-center align-items-center"
        data-bs-toggle="modal"
        data-bs-target="#staticBackdrop"
      >
        <i className="fas fa-plus text-light"></i>
      </button>

      {/* ================= üìçstart modal ================= */}
      <TestModal Formik={Formik} initialValues={initialValues} />
      {/* ================= üìçend modal ================= */}
    </div>
  );
};
